static void usage(const char* prog)
{
    printf("Usage: %s packingType packingStage outfile\n", prog);
    printf("packingStage: either packing_type_before_values or values_before_packing_type\n");
    exit(1);
}

typedef enum {
    PACKING_TYPE_BEFORE_VALUES,
    VALUES_BEFORE_PACKING_TYPE
} PackingStage;


#define EPSILON 1e-5

int main(int argc, char** argv)
{
    size_t values_len = sizeof(values)/sizeof(values[0]);
    const char* sample_filename = "gg_sfc_grib2";
    grib_handle* h = NULL;
    size_t str_len  = 0;
    PackingStage packing_stage;
    char* packing_type;
    char* outfile_name;
    int check = 1;

    if (argc != 4) usage(argv[0]);
    
    packing_type = argv[1];
    if (strcmp(argv[2], "packing_type_before_values")==0)
        packing_stage = PACKING_TYPE_BEFORE_VALUES;
    else if (strcmp(argv[2], "values_before_packing_type")==0)
        packing_stage = VALUES_BEFORE_PACKING_TYPE;
    else
        exit(1);

    outfile_name = argv[3];

    fprintf(stderr,"Using sample_filename = %s\n", sample_filename);
    h = grib_handle_new_from_samples(0, sample_filename);
    Assert(h);
    
    if (strcmp(packing_type, "grid_second_order")==0 && packing_stage == VALUES_BEFORE_PACKING_TYPE) {
        check = 0; /* TDOD */
    }

    GRIB_CHECK(grib_set_long(h, "bitsPerValue", 16), 0);
    if (packing_stage == PACKING_TYPE_BEFORE_VALUES) {
        fprintf(stderr,"Set packingType to %s\n", packing_type);
        GRIB_CHECK(grib_set_string(h, "packingType", packing_type, &str_len), 0);
    }
    
    fprintf(stderr,"Set values. values_len=%lu\n", (unsigned long)values_len);
    GRIB_CHECK(grib_set_double_array(h, "values", values, values_len), 0);
    
    if (packing_stage == VALUES_BEFORE_PACKING_TYPE) {
        fprintf(stderr, "Set packingType to %s\n", packing_type);
        GRIB_CHECK(grib_set_string(h, "packingType", packing_type, &str_len), 0);
    }
    
    GRIB_CHECK(grib_write_message(h, outfile_name, "w"), 0);

    fprintf(stderr, "%s checks on decoded values '%s' (%s) ...\n",
            (check?"Doing":"Skipping"), packing_type, argv[2]);
    if (check) {
        size_t i = 0;
        double* vals = (double*)malloc(sizeof(double) * values_len);
        GRIB_CHECK(grib_get_double_array(h, "values", vals, &values_len), 0);
        for (i = 0; i < values_len; i++) {
            const double diff = fabs(values[i] - vals[i]);
            if (diff > EPSILON) {
                fprintf(stderr, "Unpacked value different at i=%lu: original=%.7f decoded=%.7f\n",
                        i, values[i], vals[i]);
                return 1;
            }
        }
        if (strcmp(packing_type, "grid_simple")==0 || strcmp(packing_type, "grid_ieee")==0) {
            double calc = 0;
            long offsetAfterData = 0, offsetBeforeData = 0;
            GRIB_CHECK(grib_get_long(h, "offsetAfterData",  &offsetAfterData), 0);
            GRIB_CHECK(grib_get_long(h, "offsetBeforeData", &offsetBeforeData), 0);
            calc = (offsetAfterData - offsetBeforeData) * 8.0 / values_len;
            printf("bitsPerValue calculated as = (offsetAfterData - offsetBeforeData)*8/numValues = %g\n", calc);
            Assert( calc == 16 || calc == 32 || calc == 64 );
        }
        free(vals);
    }

    grib_handle_delete(h);
    fprintf(stderr,"All done\n");
    return 0;
}
